देश को सिर्फ एक्ट नहीं एक्शन भी चाहिए।

पिछली सरकार Food Security Act लेकर आई, बहुत हल्ला किया गया, लेकिन 2014 तक सिर्फ 11 राज्यों के लोगों को ही इसका लाभ मिलता था। हमने आने के बाद सुनिश्चित किया कि पूरे भारत को इसका लाभ मिले : पीएम 
