 जी एक ऐसे लोकप्रिय नेता है जिन्हें देश की सवा सौ करोड़ जनता ह्रदय से स्वीकारती है। मोदी जी ने देश की जनता के दिल की गहराइयों तक अपना स्थान बनाया है: श्री अमित शाह
